func countSubarrays(nums []int, k int) int64 {
    n := len(nums)
    maxVal := 0
    for _, num := range nums {
        if num > maxVal {
            maxVal = num
        }
    }

    count, left, freq := int64(0), 0, 0
    for right := 0; right < n; right++ {
        if nums[right] == maxVal {
            freq++
        }
        while freq >= k {
            count += int64(n - right)
            if nums[left] == maxVal {
                freq--
            }
            left++
        }
    }
    return count
}
